description:
Reenactment of terrifying tales of people who were kidnapped, yet were lucky enough to survive. Each episode centers on one person's ordeal. Starting from before the abduction right through to the hours, days, or months of captivity and finally to the escape and recovery as told by the victim in their own haunting recollection. 
